module.exports = "<div class=\"container\">\r\n  <div class=\"row\">\r\n    \r\n    <div class=\"col-lg-8 all-padd1\">\r\n      <div id=\"reviewers\">\r\n        <div>\r\n          <h2>Guidelines for Reviewers</h2>\r\n          \r\n            <p>The reviewer report should comprehensively critique the submission and consist\r\n               of much more than a few brief sentences. JIC does not require a specific structure\r\n                for reports, however, a suggested format is:\r\n          </p>\r\n          <p>•\tSummary</p>\r\n<p>•\tMajor issues</p>\r\n<p>•\tMinor issues</p>\r\n<p>We encourage reviewers to help authors improve their manuscript. The report should give constructive analysis to authors, particularly where revisions are recommended. Where reviewers do not wish authors to see certain comments, these can be added to the confidential comments to the Academic Editor.</p>\r\n<p>While expectations vary by discipline, some core aspects that should be critiqued by reviewers may include:</p>\r\n<p>•\tAre the research questions valid?</p>\r\n<p>•\tIs the sample size sufficient?</p>\r\n<p>•\tIs there necessary ethical approval and/or consent and was the research ethical?</p>\r\n<p>•\tAre the methods and study design appropriate for answering the research question?</p>\r\n<p>•\tDo the experiments have appropriate controls?</p>\r\n<p>•\tIs the reporting of the methods, including any equipment and materials, sufficiently detailed that the research might be reproduced?</p>\r\n<p>•\tAre any statistical tests used appropriate and correctly reported?</p>\r\n<p>•\tAre the figures and tables clear and do they accurately represent the results?</p>\r\n<p>•\tHas previous research by the authors and others been discussed and have those results been compared to the current results?</p>\r\n<p>•\tAre there any inappropriate citations, for example, not supporting the claim being made or too many citations to the authors' own articles?</p>\r\n<p>•\tDo the results support the conclusions?</p>\r\n<p>•\tAre limitations of the research acknowledged?</p>\r\n<p>•\tIs the abstract an accurate summary of the research and results, without spin?</p>\r\n<p>•\tIs the language clear and understandable?</p>\r\n<p>•\tDoes the paper discuss novel and/or unpublished work?</p>\r\n<p>•\tWithin its field of specialization, is the topic important?</p>\r\n<p>•\tThe study provides limited new information?</p>\r\n<p>•\tHow is this scientific significance likely to change over the next 5 years?</p>\r\n<p>To help authors receive timely reviews, reviewer reports should be submitted via the manuscript tracking system on or before the agreed deadline. Reviewers should contact the journal if they are unable to meet the deadline so an alternative date can be arranged.</p>\r\n\r\n<p>We encourage reviewers to focus their reports on objectively critiquing the scientific aspects of the submission, including the soundness of the methodology and whether the conclusions can be supported by the results. Comments may also be given on novelty and the potential impact of the work. At the end of their review, we ask reviewers to recommend one of the following actions:</p>\r\n<p>•\tPublish Unaltered</p>\r\n<p>•\t Re-review after thoroughly revise as noted</p>\r\n<p>•\tAccepted with major revisions</p>\r\n<p>•\tAccepted with minor revisions</p>\r\n<p>•\tReject: Manuscript is flawed or not sufficiently novel</p>\r\n\r\n\r\n<p>However, it is important to note that the overall decision will be made by the Academic Editor.</p>\r\n\r\n<h5>Applications to Review</h5>\r\n\r\n<p>We appreciate applications to join our community of peer reviewers. Our Academic Editors select reviewers on a manuscript-by-manuscript basis. In each case they invite the most appropriate scientists from their own network or via our recommendation list. To ensure we have your up-to-date contact details, interested reviewers should register for a user account.</p>\r\n\r\n\r\n          </div>\r\n      </div>\r\n    </div>\r\n\r\n    <div class=\"col-lg-4\">\r\n      <div class=\"tab1\">\r\n        <!-- Right side section starts -->\r\n        <div class=\"quickSt\">Quick Links</div>\r\n          <table class=\"table \">\r\n            <tr>\r\n              <td colspan=\"2\"><i class=\"fa fa-leanpub\" style=\"font-size:25px;color:red\"></i>\r\n                Journal metrics</td>\r\n            </tr>\r\n            <!-- <tr>\r\n              <td>Acceptance rate</td>\r\n              <td>12%\r\n              </td>\r\n            </tr>\r\n            <tr>\r\n              <td>Submission to final decision</td>\r\n              <td>63 days</td>\r\n            </tr>\r\n            <tr>\r\n              <td>Acceptance to publication</td>\r\n              <td>77 days</td>\r\n            </tr>\r\n            <tr>\r\n              <td>CiteScore</td>\r\n              <td>0.580</td>\r\n            </tr>\r\n            <tr>\r\n              <td>Impact Factor</td>\r\n              <td>-</td>\r\n            </tr> -->\r\n            <tr class=\"alert alert-info\">   <!--style=\"background-color: cadetblue;\" -->\r\n              <td><i class=\"fa fa-money-bill\"></i>&nbsp;APC</td>\r\n              <td>$ 599<sup>*</sup></td>\r\n            </tr>\r\n            <tr>\r\n              <td><i class=\"fa fa-folder-open\" style=\"font-size:25px; color: brown;\"></i>&nbsp;Submit</td>\r\n              <td><a routerLink=\"/submit\"><i class=\"fa fa-arrow-right\"></i></a></td>\r\n            </tr>\r\n            <tr class=\"bgclr\">\r\n              <td><i class=\"fa fa-wpforms\" style=\"font-size:25px; color: brown;\"></i>&nbsp;Author Guidelines</td>\r\n              <td><a routerLink=\"/authors\"><i class=\"fa fa-arrow-right\"></i></a></td>\r\n            </tr>\r\n            \r\n            <tr class=\"bgclr\">\r\n              <td><i class=\"fa fa-wpforms\" style=\"font-size:25px; color: brown;\"></i>&nbsp;Editor Guidelines</td>\r\n              <td><a routerLink=\"/editors\"><i class=\"fa fa-arrow-right\"></i></a></td>\r\n            </tr>\r\n            <tr class=\"bgclr2\">\r\n              <td><i class=\"fa fa-users\"  style=\"font-size:25px; color: brown;\"></i>&nbsp;Editorial Board</td>\r\n              <td><a routerLink=\"/editorialboard\"><i class=\"fa fa-arrow-right\"></i></a></td>\r\n            </tr>\r\n            <!-- <tr class=\"bgclr3\">\r\n              <td><small><sup>*</sup>We want grow, we are not concerned about fee</small></td>\r\n              <td></td>\r\n            </tr> -->\r\n            \r\n      \r\n            <!-- <i class=\"fa fa-car\"></i>\r\n            <i class=\"fa fa-car\" style=\"font-size:48px;\"></i>\r\n            <i class=\"fa fa-car\" style=\"font-size:60px;color:red;\"></i> -->\r\n          </table>\r\n      \r\n      \r\n      </div>\r\n     \r\n    </div>\r\n  </div>\r\n</div>"

